	def show
		
		respond_to do |format|
			format.html {
				@petition = Petition.find(params[:id])
				@casefile = Casefile.find_by_ccn("CCN"+@petition.ccn)
				@title=@petition.defendant+" CCN: "+@petition.ccn
				render 'show'
				}
			format.json {
				if (params[:ccn].nil?)&(!params[:defendant].nil?)
					@petition = Petition.find_by_defendant(params[:defendant])
				elsif !params[:ccn].nil?
					@petition = Petition.find_by_ccn(params[:ccn])
					@casefile = Casefile.find_by_ccn("CCN"+params[:ccn])
				else
					return
				end
				render :json => @petition
				}
		end
	end
	
	def edit
		@petition = Petition.find(params[:id])
	end
	
	def update
		@petition = Petition.find(params[:id])
		if @petition.update_attributes(params[:petition])
			redirect_to @petition
		else
			render 'edit'
		end
	end
		private
		def authorized_user
			@petition = Petition.find_by_id(params[:id])
			if !current_user.admin? 
				redirect_to root_path
			else
				#
			end
		end
end
